issue.body:
I've noticed that when I'm using NLog through Microsoft.Extensions.Logging, the end of the application doesn't log as expected when using an async wrapper with the latest version of NLog.Extensions.Logging. If I add intermediate code, it logs, up until the very end of the application (almost like something isn't "turning out the lights," so to speak). Downgrading to NLog.Extensions.Logging 1.7.5 fixes the issue, as does a Thread.Sleep or LogManager.Shutdown before the end of the application.

**NLog version**: 5.0.5
**NLog.Extensions.Logging version**: 5.1.0

**Platform**:  .NET6

