<nlog xmlns="http://www.nlog-project.org/schemas/NLog.xsd"
      xmlns:xsi="http://www.w3.org/2001/XMLSchema-instance"
      autoReload="true"
      internalLogLevel="Info"
      internalLogFile="logs\internal\nlog.log">
  <variable name="internalLogDir" value="logs\internal"/>
  <variable name="baseLogDir" value="logs"/>

	<targets>
		<target
		  xsi:type="File"
		  name="BaseLog"
		  createDirs="true"
		  autoFlush="true"
		  fileName="${baseLogDir}\NLogTest.log"
		  layout="${longdate} ${callsite} ${level} ${message} ${exception:format=tostring}"
		  archiveEvery="Day"
		  archiveNumbering="Date"
		  archiveDateFormat="yyyy-MM-dd"
		  maxArchiveFiles="7"
		  concurrentWrites="true" />
		<wrapper-target xsi:type="AsyncWrapper" name="asyncBase">
			<target-ref name="BaseLog"/>
		</wrapper-target>
	</targets>
  <rules>    
    <logger name="*" minlevel="Debug" writeTo="asyncBase"/>
  </rules>
</nlog>

```
