NLog hooks into AppDomain.Unload and performed flush/shutdown on these "final" events. 

Sadly enough Microsoft .NET signals these events on Linux before application is fully shutdown, thus causing the NLog logging to become silent and fails logging all events during application-shutdown.

When using NLog.Extensions.Logging v5 then it is expected that the developer cares about object-lifetime and disposes its objects for correct shutdown.

**Solution 1:**
Change this:
```c#
var serviceProvider = services.BuildServiceProvider();
```
To this (Adding `using`):
```
using var serviceProvider = services.BuildServiceProvider();
```

**Solution 2**
Introduce finally-block:
```c#
try
{
   // App Code
}
finally
{
   NLog.LogManager.Shutdown();
}
```

